import React from "react";

class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      date: new Date(),
      company: "",
      code: "",
    };
    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }
  handleChange(event) {
    this.setState({
      [event.name]: event.target.value,
    });
  }
  render() {
    return (
      <div>
        <form>
          <select>
            <option name="company" selected value="null">
              택배사 정보
            </option>
            <option name="company" selected value="cj">
              CJ대한통운
            </option>
            <option>한진택배</option>
            <option>경동택배</option>
          </select>
          <input type="text" />
          <button className="button">확 인</button>
        </form>
      </div>
    );
  }
}
export default Home;
